    name: "chicken",
    image: "https://www.google.com/search?q=%EC%B9%98%ED%82%A8&tbm=isch&ved=2ahUKEwjg6aiOoaDwAhWkQfUHHedJCiQQ2-cCegQIABAA&oq=%EC%B9%98%ED%82%A8&gs_lcp=CgNpbWcQAzIFCAAQsQMyAggAMgUIABCxAzIFCAAQsQMyBQgAELEDMgUIABCxAzIFCAAQsQMyBQgAELEDMgUIABCxAzIFCAAQsQNQ2SBY4iNg-CRoAXAAeAGAAaYBiAHrBJIBAzAuNJgBAKABAaoBC2d3cy13aXotaW1nwAEB&sclient=img&ei=jPmIYODzBqSD1e8P55OpoAI"
