    image: "https://www.google.com/search?q=%EC%8A%A4%EC%8B%9C&tbm=isch&ved=2ahUKEwjm9erQoKDwAhWLaN4KHWPBAHgQ2-cCegQIABAA&oq=%EC%8A%A4%EC%8B%9C&gs_lcp=CgNpbWcQAzICCAAyAggAMgIIADICCAAyAggAMgIIADICCAAyAggAMgIIADICCAA6BQgAELEDOggIABCxAxCDAVCV2AdYy9oHYIHcB2gBcAB4AYABlQGIAcMEkgEDMC40mAEAoAEBqgELZ3dzLXdpei1pbWfAAQE&sclient=img&ei=C_mIYKbECovR-QbjgoPABw"
  },
  {
    name: "taco",
    image: "https://www.google.com/search?q=%ED%83%80%EC%BD%94&tbm=isch&ved=2ahUKEwjIn--8oKDwAhXVRt4KHSKoBakQ2-cCegQIABAA&oq=%ED%83%80%EC%BD%94&gs_lcp=CgNpbWcQAzICCAAyAggAMgIIADICCAAyAggAMgIIADICCAAyAggAMgIIADICCAA6BQgAELEDOggIABCxAxCDAToECAAQA1DdqwJYj7cCYMG4AmgEcAB4AYABqQGIAasHkgEDMC42mAEAoAEBqgELZ3dzLXdpei1pbWewAQDAAQE&sclient=img&ei=4fiIYIirEtWN-Qai0JbICg"
  }
]

function Food({ name, picture }) {
  return (
    <div>
      <h2>I like {name}</h2>
      <img src={picture} />
    </div>
  )
}

function App() {
  return (
    <div>
      {foodsILike.map(food => ( 
          <Food name={food.name} picture={food.image} /> ))}
    </div>
  );
}

export default App;
